contract NFTBatchMinting is ERC721, ERC721Enumerable, ERC721URIStorage, Pausable, Ownable, ERC721Burnable {
    using Counters for Counters.Counter;

    Counters.Counter private _tokenIdCounter;
    uint256 public MAX_NFTS = 502;
    uint256 public maxMint = 20;
    uint public nftPrice = 0.01 ether; // 31.21 USD

    constructor(string memory _name, string memory _symbol) ERC721(_name, _symbol) {}

    // This Function is used to Pause the Contract
    function pause() public onlyOwner {
        _pause();
    }

    // This Function is used to Unpause the Contract
    function unpause() public onlyOwner {
        _unpause();
    }

    // This Function is used to do a Single Mint. Can Only Done By Admin.
    function safeMint(address to, string memory uri) public onlyOwner {
        require(bytes(uri).length > 0,"Token URI Cant Be null.");
        require(_tokenIdCounter.current() < MAX_NFTS,"All Tokens Have been minted.");
        _tokenIdCounter.increment();
        uint256 tokenId = _tokenIdCounter.current();
        _safeMint(to, tokenId);
        _setTokenURI(tokenId, uri);
    }

    // This Function is used to do Batch Mint. Can Only Done By Admin.
	function batchMintByAdmin(address[] memory toAddresses, string[] memory newTokenURIS, uint256 _count) public onlyOwner {
        require(toAddresses.length > 0,"To Addresses Cant Be null.");
        require(newTokenURIS.length > 0,"Token URIs Cant Be null");
        require(_count > 0,"Count Cant be Zero");
        require(_tokenIdCounter.current() < MAX_NFTS,"All Tokens Have been minted.");
        require(_tokenIdCounter.current() + _count <= MAX_NFTS,"Token count exceeds with available NFT's.");
        require(_count <= maxMint,"You have exceeded max mint count.");
        require(newTokenURIS.length == _count, "Token URI's & count does not match.");

        for (uint256 i = 0; i < _count; i++) {
            
           _tokenIdCounter.increment();
            uint256 tokenId = _tokenIdCounter.current();
            _safeMint(toAddresses[i], tokenId);
            _setTokenURI(tokenId, newTokenURIS[i]);
        }
    }

    // This Function is used to do Batch Mint. Function is payable.
    function batchMint(address toAddress, string[] memory newTokenURIS, uint256 _count) public payable {
        require(newTokenURIS.length > 0,"Token URIs Cant Be null");
        require(_count > 0,"Count Cant be Zero");
        require(_tokenIdCounter.current() < MAX_NFTS,"All Tokens Have been minted.");
        require(_tokenIdCounter.current() + _count <= MAX_NFTS,"Token count exceeds with available NFT's.");
        require(_count <= maxMint,"You have exceeded max mint count.");
        require(msg.value >= nftPrice * _count, "Insuffient ETH amount sent For Purhcase NFTs.");
        require(newTokenURIS.length == _count, "Token URI's & count does not match.");

        for (uint256 i = 0; i < _count; i++) {
            
           _tokenIdCounter.increment();
            uint256 tokenId = _tokenIdCounter.current();
            _safeMint(toAddress, tokenId);
            _setTokenURI(tokenId, newTokenURIS[i]);
        }
    }

    function _beforeTokenTransfer(address from, address to, uint256 tokenId)
        internal
        whenNotPaused
        override(ERC721, ERC721Enumerable)
    {
        super._beforeTokenTransfer(from, to, tokenId);
    }

    // The following functions are overrides required by Solidity.

    function _burn(uint256 tokenId) internal override(ERC721, ERC721URIStorage) {
        super._burn(tokenId);
    }

    function tokenURI(uint256 tokenId)
        public
        view
        override(ERC721, ERC721URIStorage)
        returns (string memory)
    {
        return super.tokenURI(tokenId);
    }

    function supportsInterface(bytes4 interfaceId)
        public
        view
        override(ERC721, ERC721Enumerable)
        returns (bool)
    {
        return super.supportsInterface(interfaceId);
    }

    /*
     * @dev Used to get the tokensOfOwner.
     * @return uint256[] for tokensOfOwner.
     */
	function tokensOfOwner(address _owner) external view returns (uint256[] memory ownerTokens) {
         uint256 tokenCount = balanceOf(_owner);
         
          if (tokenCount == 0) {
            // Return an empty array
            return new uint256[](0);
        } else {
            uint256[] memory result = new uint256[](tokenCount);
            uint256 totalTokens = totalSupply();
            uint256 resultIndex = 0;

            // We count on the fact that all NFTs have IDs starting at 1 and increasing
            // sequentially up to the totalNft count.
            uint256 tokensId;

            for (tokensId = 1; tokensId <= totalTokens; tokensId++) {
                if (ownerOf(tokensId) == _owner) {
                    result[resultIndex] = tokensId;
                    resultIndex++;
                }
            }

            return result;
        }
    }

    /**
     * @dev Used to set the mint price for 1 nft.
     */
    function setNFTPrice(uint newPrice) external onlyOwner {
        nftPrice = newPrice;
    }

    /**
     * @dev Used to get the price for 1 NFT.
     * @return uint256 for 1 NFT price.
     */    
    function getNFTPrice() public view returns (uint256) {
        return nftPrice;
    }

    /**
     * @dev Used to set the max mint limit.
     */
    function setMaxMint(uint256 newMaxMint) external  onlyOwner {
        maxMint = newMaxMint;
    }

    /**
     * @dev Used to get the max mint limit.
     * @return uint256 for max mint limit.
     */
    function getMaxMint() public view returns (uint256) {
        return maxMint;
    }

    /**
     * @dev Used to set the max rat nft available.
     */
    function setMaxNfts(uint256 newMaxNfts) external  onlyOwner {
        MAX_NFTS = newMaxNfts;
    }

    /**
     * @dev Used to get the max pilaties available limit.
     * @return uint256 for max pilaties available.
     */
    function getMaxNfts() public view returns (uint256) {
        return MAX_NFTS;
    }

    // This Function is used to Update TokenURI for tokenId.
    function updateTokenURI(uint256 tokenId, string memory uri) public onlyOwner{
        _setTokenURI(tokenId, uri);
    }

    // This Function is used to withdraw ether.
    function withdraw() public onlyOwner {
        require(address(this).balance > 0, "Dosen't have a enough ETH for transfer");
        // payable(owner()).transfer(address(this).balance);
        (bool sent, bytes memory data) = owner().call{value: address(this).balance}("");
        require(sent, string(abi.encodePacked("Failed to send Ether", data)));
    }
}

